import Link from 'next/link';

const Header = () => {
    <div className="menuStyle">
        <Link href='/'>
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href='/list'>
            <a style={linkStyle}>List</a>
        </Link>
    </div>
}

export default Header;
